import React from "react";
import CourseDetails from "../CourseDetails";
import Footer from "../HomeComponents/Footer";
import Header from "../HomeComponents/Header";

const SingleCourse = () => {
  return (
    <>
      <Header />
      <CourseDetails />
      <Footer />
    </>
  );
};

export default SingleCourse;
